import { FETCH_IMAGES, UPLOAD_CSV } from './types';
import { getImages, postCsv } from '../services/CsvService';

export const fetchImages = (batch_id, page_id) => dispatch => {
  getImages(batch_id, page_id).then(response => {
    dispatch({
      type: FETCH_IMAGES,
      payload: response.data
    })
  });
}

export const uploadCsv = (file) => dispatch => {
  postCsv(file).then(response => {
    dispatch({
      type: UPLOAD_CSV,
      payload: response.data
    })
  });
}
